  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Service List'
};
export const metadata = {
  "id": "dev/service-list",
  "title": "Service List",
  "description": "In this document, some examples of implemented services will be listed. These include:",
  "source": "@site/docs/dev/service-list.md",
  "permalink": "/new-docs/docs/dev/service-list",
  "editUrl": "https://github.com/nervosnetwork/muta/edit/master/website/docs/dev/service-list.md",
  "sidebar": "docs",
  "previous": {
    "title": "Service Dev Guide",
    "permalink": "/new-docs/docs/dev/service-dev"
  },
  "next": {
    "title": "Develop an attestation service and build a POE chain",
    "permalink": "/new-docs/docs/dev/poe-chain"
  }
};
  /* @jsx mdx */

export const rightToc = [{
  value: 'Four official built-in services from Muta',
  id: 'four-official-built-in-services-from-muta',
  children: []
}, {
  value: 'Four services from Huobi-chain',
  id: 'four-services-from-huobi-chain',
  children: []
}, {
  value: 'Add your Service to the list',
  id: 'add-your-service-to-the-list',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`In this document, some examples of implemented services will be listed. These include:`}</p>
    <h3 {...{
      "id": "four-official-built-in-services-from-muta"
    }}>{`Four official built-in services from Muta`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/nervosnetwork/muta/tree/master/built-in-services/metadata"
        }}>{`Metadata Service`}</a>{`: Support the operator of the chain to configure the chain before starting the chain.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/nervosnetwork/muta/tree/master/built-in-services/asset"
        }}>{`Asset Service`}</a>{`: support for native assets to issue, transfer, query and other operations.`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/nervosnetwork/muta/tree/master/built-in-services/authorization"
        }}>{`Authorization Service`}</a>{`: Support third-party logical access to mempool, extended authentication. `}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/nervosnetwork/muta/tree/master/built-in-services/multi-signature"
        }}>{`MultiSignature Service`}</a>{`: Support for multi-signature.`}</li>
    </ul>
    <h3 {...{
      "id": "four-services-from-huobi-chain"
    }}>{`Four services from Huobi-chain`}</h3>
    <p>{`The Huobichain Service is also open source on GitHub, so please follow Huobichain's open source license for reference.`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/riscv"
          }}>{`RISC-V Service`}</a>{`：支持用户用 c 语言进行合约的开发。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/governance"
          }}>{`Governance Service`}</a>{`：支持动态添加、删除节点，以及一些专有的业务逻辑。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/admission_control"
          }}>{`AdmissionControl Service`}</a>{`：一个接入authorization的实现，提供了一些额外的校验逻辑。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/kyc"
          }}>{`kyc Service`}</a>{`：一个简单的KYC服务。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/riscv"
          }}>{`RISC-V Service`}</a>{`: Supports the development of contracts in c.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/governance"
          }}>{`Governance Service`}</a>{`: supports dynamic addition and deletion of nodes, as well as some proprietary business logic.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/admission_control"
          }}>{`AdmissionControl Service`}</a>{`: an access authorization Implementation that provides some additional checking logic.`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><a parentName="p" {...{
            "href": "https://github.com/HuobiGroup/huobi-chain/tree/master/services/kyc"
          }}>{`kyc Service`}</a>{`: a simple KYC service.`}</p>
      </li>
    </ul>
    <h3 {...{
      "id": "add-your-service-to-the-list"
    }}>{`Add your Service to the list`}</h3>
    <p>{`More services are still in development, what services have you developed based on your blockchain built by Muta?`}</p>
    <p>{`If you want to add your Service to this document for others to see, click `}<inlineCode parentName="p">{`Edit Document`}</inlineCode>{` on the right side of the document and submit a Pull Request to add the relevant information.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
